import logo from '../img/logo.png';

function Landing() {
  return (
    <div className="landing">
      <header>
        <img src={logo} alt="" />
      </header>
      <main>
        <section className="first">
          <div className="left">
            <h1>«Monorts»:
              Инновации путь в будущее!</h1>
            <button className='br-r-10'>Начать работу</button>
          </div>
          <div className="right"><img src="fond.png" alt="" /></div>
        </section>
      </main>
    </div>
  );
}

export default Landing;
